import React from "react";
import "./header.css";

const Header = ({useButtons}) => {
  return (
    <div className="head_wrapper">
      <div className="head_container paddings flexCenter ">
        <img src="./images/logo.png" alt="logo" width={40} />
        <div className="head_menu flexCenter">
          <a className = 'btn_1' href=""> Home </a>
          <a href=""> Summarize / Question </a>
          <a href=""> Note </a>
          <a href=""> About </a>
        </div>
        <div className="daynight_btn">
        <img src="./images/night-mode.png"/>
        </div>
        <div className="buttons flexCenter">
        {useButtons  ? ( 
          <><button className="login_btn btn_1"> Login </button>
          <button className="signUp_btn btn_2"> SignUp </button>
          </>):
          (<div className="account">
            <div className="account_img"> 
             <img src="./images/user.png" />
            </div>
            <div className="account_detail">
            <h1>Yonas Alemu</h1>
            <p>yonasAlemu@gmail.com</p>
            </div> 
          </div>
            )
          }
          {/* <button className="login_btn btn_1"> Login </button>
          <button className="signUp_btn btn_2"> SignUp </button> */}
        </div>
      </div>
    </div>
  );
};

export default Header;
